import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ScrumDetails.css';

const ScrumForm = ({ onClose, onCreate }) => {
    const [scrumName, setScrumName] = useState('');
    const [taskTitle, setTaskTitle] = useState('');
    const [taskDescription, setTaskDescription] = useState('');
    const [taskStatus, setTaskStatus] = useState('To Do');
    const [assignedUser, setAssignedUser] = useState('');
    const [users, setUsers] = useState([]);

    useEffect(() => {
        const fetchUsers = async () => {
            try {
                const response = await axios.get('http://localhost:4000/users');
                setUsers(response.data);
            } catch (error) {
                console.error('Error fetching users:', error);
            }
        };
        fetchUsers();
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();
        const newScrum = {
            name: scrumName,
            tasks: [{ title: taskTitle, description: taskDescription, status: taskStatus, assignedTo: assignedUser }]
        };
        onCreate(newScrum);
        setScrumName('');
        setTaskTitle('');
        setTaskDescription('');
        setTaskStatus('To Do');
        setAssignedUser('');
    };

    return (
        <div className="scrum-form">
            <label>Scrum Name:</label>
            <input type="text" value={scrumName} onChange={(e) => setScrumName(e.target.value)} />

            <label>Task Title:</label>
            <input type="text" value={taskTitle} onChange={(e) => setTaskTitle(e.target.value)} />

            <label>Task Description:</label>
            <input type="text" value={taskDescription} onChange={(e) => setTaskDescription(e.target.value)} />

            <label>Task Status:</label>
            <select value={taskStatus} onChange={(e) => setTaskStatus(e.target.value)}>
                <option value="To Do">To Do</option>
                <option value="In Progress">In Progress</option>
                <option value="Done">Done</option>
            </select>

            <label>Assign To:</label>
            <select value={assignedUser} onChange={(e) => setAssignedUser(e.target.value)}>
                <option>Select a user</option>
                {users.map(user => (
                    <option key={user.id} value={user.id}>{user.name}</option>
                ))}
            </select>

            <div className="button-group">
                <button className="cancel-btn" onClick={onClose}>Cancel</button>
                <button className="create-btn" onClick={handleSubmit}>Create Scrum</button>
            </div>
        </div>
    );
};

export default ScrumForm;
